clear
theta1 = pi/2;
theta2 = pi/2;
theta3 = pi/2;
theta4 = pi/2;
T = 15;
TT = linspace (0, T, 5000);
numOfPts = 18;

opts = odeset('RelTol', 2.2205e-14, 'AbsTol', 2.2205e-14);
[t,y] = ode113(@vdp1,[TT],[theta1; 0; theta2; 0; theta3; 0; theta4; 0], opts);
 
 
angles1 = linspace(-pi, pi, numOfPts);
angles2 = linspace(-pi, pi, numOfPts);
angles3 = linspace(-pi, pi, numOfPts);

 
s = -13;
e = -4;
num = -1*(s-e-1);
xx = zeros(1, num) + 10;
radius = linspace(s,e, num);
radius = xx.^radius;
 
Ths = zeros(1, length(radius));
for r=1:length(radius)
    matrixTh1 = zeros(1,length(TT));
    matrixTh2 = zeros(1,length(TT));
    matrixTh3 = zeros(1, length(TT));
    matrixTh4 = zeros(1, length(TT));
    o=1
    for i=1:length(angles1)
        for j=1:length(angles2)
            for k=1:length(angles3)
                newtheta1 = theta1 + (radius(r))*cos(angles1(i));
                newtheta2 = theta2 + (radius(r))*sin(angles1(i))*cos(angles2(j));
                newtheta3 = theta3 + (radius(r))*sin(angles1(i))*sin(angles2(j))*cos(angles3(k));
                newtheta4 = theta3 + (radius(r))*sin(angles1(i))*sin(angles2(j))*sin(angles3(k));
                [t1, y1] = ode113(@vdp1, [TT], [newtheta1; 0; newtheta2; 0; newtheta3; 0; newtheta4; 0], opts);
 
  
                deltatheta1 = (y1(:,1)-y(:,1));
                deltatheta2 = (y1(:,3)-y(:,3));
                deltatheta3 = (y1(:,5)-y(:,5));
                deltatheta4 = (y1(:,7)-y(:,7));
                deltatheta1 = transpose(deltatheta1);
                deltatheta2 = transpose(deltatheta2);
                deltatheta3 = transpose(deltatheta3);
                deltatheta4 = transpose(deltatheta4);
     
                
                matrixTh1 = [matrixTh1; deltatheta1];
                matrixTh2 = [matrixTh2; deltatheta2];
                matrixTh3 = [matrixTh3; deltatheta3];
                matrixTh4 = [matrixTh4; deltatheta4];
            end
        end
    end
 

 
    maxS = zeros(1,length(TT));
    for k = 1:length(TT)
        dists = zeros(1, numOfPts);
        for i = 1:length(angles1)
            distance = ((matrixTh1(i, k))^2 + (matrixTh2(i,k)^2) + (matrixTh3(i,k)^2)+matrixTh4(i,k)^2)^0.5;
            dists(i) = distance;
        end
        maximum = max(dists);
        maxS(k) = maximum;
    end
 

    subtracted = (maxS - 10^-3);

    
    counter = 0;
    flag = 0;
    for t = 1:length(TT)
        if subtracted(t)<=0 & flag == 0
            counter = counter + 1;
        end
        if subtracted(t)>0
            flag = 1;
        end
    end
    
    TT(counter)
    radius(r)
    Ths(r) = TT(counter);      
        
 

end
 
plot(log10(radius), Ths)
 
